  const menu = ["ESG", "항공","렌터카","숙박","맛집","카페패스"]
  return (
    <div className="App">
      <div className="nav">
        <div className="nav-top">
          <img src="https://t1.daumcdn.net/cfile/tistory/99611A4F5EF3FFAD24"/>
          <div className="nav-center">
            <ul>
              {menu.map((menu)=>(<li>{menu}</li>))}
            </ul>
          </div>
          <div className="nav-right">

          </div>
        </div>
      </div>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
